import React from "react";
import git from "../assets/images/git.jpg";

const Application = ({application}) => {
// Create cards for each application
    return (
        <figure className="applicationCard">
            
            <div className="applicationText">
            
                <div className="applicationLinks">
                
                <a href={application.deploy} target="_blank"><h3>{application.name}</h3></a>
                <a href={application.repo} target="_blank"><img className="applicationLogo" alt="Git Logo" src={github}></img></a>
                
                </div>
                
                <p>{project.desc}</p>
                
            </div>
            <img className="projectBackground" alt={project.name} src={require(`../../assets/images/${project.image}`).default} />
           
        </figure>

    )
}
